Management believes that the following matters are those most critical to our success: (1) controlling our interest rate risk exposure; (2) monitoring and limiting our credit risk; (3) maintaining access to adequate liquidity and diverse funding sources to support our growth; and (4) monitoring and controlling our operating expenses.
Controlling Our Interest Rate Risk Exposure. Historically, our greatest risk has been our exposure to changes in interest rates. When we hold longer-term, fixed-rate assets, funded by liabilities with shorter-term re-pricing characteristics, we are exposed to potentially adverse impacts from changing interest rates, and most notably rising interest rates. Generally, and particularly over extended periods of time that encompass full economic cycles, interest rates associated with longer-term
assets, like fixed-rate mortgages, have been higher than interest rates associated with shorter-term funding sources, like deposits. This difference has been an important component of our net interest income and is fundamental to our operations.
A challenge to our business model occurs when there is a rapid and substantial increase in short-term rates or there is an extended inverted yield curve, which have both occurred over recent periods. This economic environment has resulted in a decrease in our net interest margin.
To mitigate our interest rate risk in general and to address the current rate environment specifically, we utilize a variety of strategies that include:
Maintaining regulatory capital in excess of levels required to be considered well capitalized;
Promoting adjustable-rate loans and shorter-term fixed-rate loans;
Marketing home equity lines of credit, which carry an adjustable rate of interest, indexed to the prime rate;
Opportunistically extending the duration of our funding sources;
Utilizing interest rate swaps to convert short-term FHLB advances and brokered certificates of deposit into long-term, fixed-rate borrowings; and
Selectively selling a portion of our long-term, fixed-rate mortgage loans in the secondary market.
Levels of Regulatory Capital
At September 30, 2023, the Companys Tier 1 (leverage) capital totaled $1.83 billion, or 10.96% of net average assets and 19.13% of risk-weighted assets, while the Associations Tier 1 (leverage) capital totaled $1.64 billion, or 9.82% of net average assets and 17.15% of risk-weighted assets. Each of these measures is in excess of the requirements currently in effect for the Association for designation as well capitalized under regulatory prompt corrective action provisions, which set minimum levels of 5.00% of net average assets and 8.00% of risk-weighted assets. Beginning this fiscal year, the Company entered into the final three years of the five-year transitional period, as provided by a final rule, after CECL was adopted in fiscal year 2021. Refer to the Liquidity and Capital Resources section of this Item 7 for additional discussion regarding regulatory capital requirements.
Promotion of Adjustable-Rate Loans and Shorter-Term, Fixed-Rate Loans
We offer our "Smart Rate" adjustable-rate mortgage loan, which provides us with improved interest rate risk characteristics when compared to a 30-year, fixed-rate mortgage loan.
