Marketing of Home Equity Lines of Credit
We actively market home equity lines of credit, which carry an adjustable rate of interest indexed to the prime rate which provides interest rate sensitivity to that portion of our assets and is a meaningful strategy to manage our interest rate risk profile. Increasing our investments in loans with variable rates of interest help to better match the maturities and interest rates of our assets and liabilities, thereby reducing the exposure of our net interest income to changes in market interest rates. We strive to grow the home equity line of credit portfolio through offering competitive rates, marketing efforts, and by utilizing partners to attract more home equity line of credit customers. At September 30, 2023, the principal balance of home equity lines of credit totaled $2.63 billion. Our home equity lending is discussed in the preceding Lending Activities section of Item 1. Business in Part I. THIRD FEDERAL SAVINGS AND LOAN ASSOCIATION OF CLEVELAND.
Extending the Duration of Funding Sources
As a complement to our strategies to shorten the duration of our interest-earning assets, as described above, we also seek to lengthen the duration of our interest-bearing funding sources. These efforts include monitoring the relative costs of alternative funding sources such as retail certificates of deposit, brokered certificates of deposit, longer-term (e.g. four to six
years) fixed-rate advances from the FHLB of Cincinnati, and shorter-term (e.g. three months) funding, the durations of which are extended by correlated interest rate exchange contracts ("swap"). All of our swaps are subject to collateral pledges and require specific structural features to qualify for hedge accounting treatment. Hedge accounting treatment directs that periodic mark-to-market adjustments be recorded in other comprehensive income (loss) in the equity section of the balance sheet, rather than being included in operating results of the income statement. The Association's intent is that any swap to which it may be a party will qualify for hedge accounting treatment.
The Association is a party to interest rate swap agreements. Each of the Association's swap agreements is registered on the Chicago Mercantile Exchange and involves the exchange of interest payment amounts based on a notional principal balance. No exchange of principal amounts occur and the notional principal amount does not appear on our balance sheet. The Association uses swaps to extend the duration of its funding sources. In each of the Association's agreements, interest paid is based on a fixed rate of interest throughout the term of each agreement while interest received is based on an interest rate that resets and compounds daily over a specified interval (generally three months) throughout the term of each agreement. On the initiation date of the swap, the agreed upon exchange interest rates reflect market conditions at that point in time. Swaps generally require counterparty collateral pledges that ensure the counterparties' ability to comply with the conditions of the agreement. Concurrent with the execution of each swap, the Association enters into a short-term borrowing in an amount equal to the notional amount of the swap and with interest rate resets aligned with the reset interval of the swap. Each individual swap agreement has been designated as a cash flow hedge of interest rate risk associated with either the Company's variable rate borrowings from the FHLB of Cincinnati or brokered CD's. In these challenging economic times with an extended inverted yield curve, the Association has found it financially beneficial to increase the use of swaps to lower our borrowing costs and extend the duration of our liabilities. For more details, refer to Notes 10. BORROWED FUNDS and 17. DERIVATIVE INSTRUMENTS to the unaudited consolidated financial statements.
Each funding alternative is monitored and evaluated based on its effective interest payment rate, options exercisable by the creditor (early withdrawal, right to call, etc.), and collateral requirements. Refer to Notes 10. DEPOSITS and 17. BORROWED FUNDS for additional details on balances. The interest payment rate is a function of market influences that are specific to the nuances and market competitiveness/breadth of each funding source. Generally, early withdrawal options, subject to a fee, are available to our retail CD customers but not to holders of brokered CDs; issuer call options are not provided on our advances from the FHLB of Cincinnati; and we are not subject to early termination options with respect to our interest rate exchange contracts. Additionally, collateral pledges are not provided with respect to our retail CDs or our brokered CDs, but are required for our advances from the FHLB of Cincinnati as well as for our interest rate exchange contracts. We will continue to evaluate the structure of our funding sources based on current needs.
Other Interest Rate Risk Management Tools
We also manage interest rate risk by selectively selling a portion of our long-term, fixed-rate mortgage loans in the secondary market. First mortgage loans (primarily fixed-rate, mortgage refinances with terms of 15 years or more and Home Ready) are originated under Fannie Mae procedures and are eligible for sale to Fannie Mae either as whole loans or within mortgage-backed securities. Currently, certain types of loans (i.e. our Smart Rate adjustable-rate loans, home purchase fixed-rate loans and 10-year fixed-rate loans) are originated under our legacy procedures, which are not eligible for sale to Fannie Mae. We can also manage interest rate risk by selling non-Fannie Mae compliant mortgage loans to private investors, although those transactions may be limited to loans that have established payment histories, strong borrower credit profiles and are supported by adequate collateral. Additionally, sales to private investors are dependent upon favorable market conditions, including motivated buyers, and involve more complicated negotiations and longer settlement timelines. Loan sales are discussed in more detail within the Liquidity and Capital Resources section of this Item 7.
During the fiscal year ended September 30, 2023, $77.2 million of agency-compliant, long-term (15 to 30 years), fixed-rate mortgage loans were sold, or committed to be sold, to Fannie Mae on a servicing retained basis. Of these sold loans, $43.5 million were originated through Mortgage Passport, and $33.7 million were originated as other agency-compliant first mortgage loans. At September 30, 2023, loans that are classified as held for sale total $3.3 million. As of September 30, 2023, we serviced $1.93 billion of loans we originated and later sold to investors.
We continue to consider liquidity and balance sheet management, as well as secondary market pricing, in evaluating the opportunity to sell loans. Additionally, we are expanding our ability to sell certain fixed-rate loans to Fannie through the use of more traditional mortgage banking activities, including a proprietary approach to risk-based pricing and loan-level pricing adjustments. This approach is concentrated in markets outside of Ohio and Florida. Some additional startup and marketing costs have been incurred, but are not expected to significantly impact our financial results in fiscal year 2023. Loan sales are discussed in more detail within the Liquidity and Capital Resources section of this Item 7.
Monitoring and Limiting Our Credit Risk. While, historically, we had been successful in limiting our credit risk exposure by generally imposing high credit standards with respect to lending, the memory of the 2008 housing market collapse and financial crisis is a constant reminder to focus on credit risk. In response to the evolving economic landscape, we continuously revise and update our quarterly analysis and evaluation procedures, as needed, for each category of our lending with the objective of identifying and recognizing all appropriate credit losses. At September 30, 2023, 90% of our assets consisted of residential real estate loans (both held for sale and held for investment) and home equity loans and lines of credit. Our analytic procedures and evaluations include specific reviews of all home equity loans and lines of credit that become 90 or more days past due, as well as specific reviews of all first mortgage loans that become 180 or more days past due. We transfer performing home equity lines of credit subordinate to first mortgages delinquent greater than 90 days to non-accrual status. We also charge-off performing loans to collateral value and classify those loans as non-accrual within 60 days of notification of all borrowers filing Chapter 7 bankruptcy, that have not reaffirmed or been dismissed, regardless of how long the loans have been performing.
In an effort to align our credit risk exposure with the low risk appetite approved by the Board of Directors, the credit eligibility criteria is evaluated to ensure a successful homeowner has the primary source of repayment, followed by a collateral position that allows for a secondary source of repayment, if needed. Products that do not result in an effective mix of repayment ability are not offered. We use stringent, conservative lending standards for underwriting to reduce our credit risk. For first mortgage loans originated or purchased during the current fiscal year, the average credit score was 774, and the average LTV was 71% at origination. The delinquency level related to loan originations prior to 2009, compared to originations or purchases in 2009 and after, reflect the higher credit standards to which we have subjected all new originations. As of September 30, 2023, loans originated prior to 2009 had a balance of $276.5 million, of which $5.5 million, or 2.0%, were delinquent, while loans originated or purchased in 2009 and after had a balance of $15.0 billion, of which $17.8 million, or 0.1%, were delinquent.
One aspect of our credit risk concern relates to high concentrations of our loans that are secured by residential real estate in specific states, particularly Ohio and Florida, where a large portion of our historical lending has occurred. At September 30, 2023, approximately 57.2% and 17.7% of the combined total of our residential Core and construction loans held for investment and approximately 25.5% and 22.0% of our home equity loans and lines of credit were secured by properties in Ohio and Florida, respectively. In an effort to moderate the concentration of our credit risk exposure in individual states, we have utilized direct mail marketing, our internet site and our customer service call center to extend our lending activities to other attractive geographic locations. Currently, in addition to Ohio and Florida, we are actively lending in 23 other states and the District of Columbia, and as a result of that activity, the concentration ratios of the combined total of our residential Core and construction loans held for investment in Ohio and Florida have trended downward from their September 30, 2010 levels when the concentrations were 79.1% in Ohio and 19.0% in Florida. Of the total mortgage loan originations and purchases for the year ended September 30, 2023, 25.8% are secured by properties in states other than Ohio or Florida.
Maintaining Access to Adequate Liquidity and Diverse Funding Sources to Support our Growth. For most insured depositories, customer and community confidence are critical to their ability to maintain access to adequate liquidity and to conduct business in an orderly manner. We believe that a well capitalized institution is one of the most important factors in nurturing customer and community confidence. Accordingly, we plan to manage the pace of our growth in a manner that reflects our emphasis on high capital levels. At September 30, 2023, the Associations ratio of Tier 1 (leverage) capital to net average assets (a basic industry measure that deems 5.00% or above to represent a well capitalized status) was 9.82%. The Association's Tier 1 (leverage) capital ratio at September 30, 2023 included the negative impact of a $40 million cash dividend payment that the Association made to the Company, its sole shareholder, in December 2022. Because of its intercompany nature, this dividend payment did not impact the Company's consolidated capital ratios. We expect to continue to remain a well capitalized institution.
In managing its level of liquidity, the Company monitors available funding sources, which include attracting new deposits (including brokered deposits), borrowing from others, the conversion of assets to cash and the generation of funds through profitable operations. The Company has traditionally relied on retail deposits as its primary means in meeting its funding needs. To attract deposits, we typically offer rates that are competitive with the rates on similar products offered by other financial institutions. At September 30, 2023, deposits totaled $9.45 billion (including $1.16 billion of brokered CDs), while borrowings totaled $5.27 billion and borrowers advances and servicing escrows totaled $154.2 million, combined. In evaluating funding sources, we consider many factors, including cost, collateral, duration and optionality, current availability, expected sustainability, impact on operations and capital levels.
We preserve the availability of alternative funding sources through various mechanisms. First, by maintaining high capital levels, we retain the flexibility to increase our balance sheet size without jeopardizing our capital adequacy. Effectively, this permits us to increase the rates that we offer on our deposit products thereby attracting more potential customers. Second, we pledge available real estate mortgage loans with the FHLB of Cincinnati and the FRB-Cleveland. At September 30, 2023, the
Association had the ability to borrow a maximum of $6.63 billion from the FHLB of Cincinnati and $126.4 million from the FRB-Cleveland Discount Window. As of September 30, 2023, our capacity for additional borrowing from FHLB of Cincinnati was $1.38 billion, Third, we have the ability to purchase overnight Fed Funds up to $585.0 million through various arrangements with other institutions. Fourth, we invest in high quality marketable securities that exhibit limited market price variability and, to the extent that they are not needed as collateral for borrowings, can be sold in the institutional market and converted to cash. At September 30, 2023, our investment securities portfolio totaled $508.3 million. Finally, cash flows from operating activities have been a regular source of funds. During the fiscal years ended September 30, 2023 and 2022, cash flows from operations totaled $90.7 million and $38.9 million, respectively.
Overall, while customer and community confidence can never be assured, the Company believes that our liquidity is adequate and that we have adequate access to alternative funding sources.
Monitoring and Controlling Our Operating Expenses. We continue to focus on managing operating expenses. Our ratio of non-interest expense to average assets was 1.31% for the fiscal year ended September 30, 2023 and 1.34% for the fiscal year ended September 30, 2022. As of September 30, 2023, our average assets per full-time associate and our average deposits per full-time associate were $17.1 million and $9.5 million, respectively. We believe that each of these measures compares favorably with industry averages. Our relatively high average deposits (exclusive of brokered accounts) held at our branch offices ($224.0 million per branch office as of September 30, 2023) contributes to our expense management efforts by limiting the overhead costs of serving our customers. We will continue our efforts to control operating expenses as we grow our business.
Critical Accounting Policies and Estimates
Critical accounting policies and estimates are defined as those that involve significant judgments and uncertainties, and could potentially give rise to materially different results under different assumptions and conditions. We believe that the most critical accounting policies and estimates upon which our financial condition and results of operations depend, and which involve the most complex subjective decisions or assessments, relate to the allowance for credit losses, income taxes and pension benefits.
Allowance for Credit Losses. The allowance for credit losses is the amount estimated by management as necessary to absorb credit losses related to both the loan portfolio and off-balance sheet commitments based on a life of loan methodology. The amount of the allowance is based on significant estimates and the ultimate losses may vary from such estimates as more information becomes available or conditions change. The methodology for determining the allowance for credit losses is considered a critical accounting policy by management due to the high degree of judgment involved, the subjectivity of the assumptions used and the potential for changes in the economic environment that could result in changes to the amount of the recorded allowance for credit losses. At September 30, 2023, the allowance for credit losses was $102.6 million or 0.67% of total loans. An increase or decrease of 10% in the allowance at September 30, 2023 would result in a $10.3 million charge or release, respectively, to income before income taxes.
As a substantial percentage of our loan portfolio is collateralized by real estate, appraisals of the underlying value of property securing loans are critical in determining the charge-offs for specific loans. Assumptions are instrumental in determining the value of properties. Overly optimistic assumptions or negative changes to assumptions could significantly affect the valuation of a property securing a loan and the related allowance determined. Management carefully reviews the assumptions supporting such appraisals to determine that the resulting values reasonably reflect amounts realizable on the related loans.
Management performs a quarterly evaluation of the adequacy of the allowance for credit losses. We consider a variety of factors in establishing this estimate including, but not limited to, current economic conditions, delinquency statistics, geographic concentrations, economic forecasts and how they correlate to management's view of the future, the adequacy of the underlying collateral, the financial strength of the borrower, results of internal loan reviews and other relevant factors. This evaluation is inherently subjective as it requires material estimates by management that may be susceptible to significant change based on changes in economic and real estate market conditions. Refer to Note 5. LOANS AND ALLOWANCES FOR CREDIT LOSSES of the NOTES TO CONSOLIDATED FINANCIAL STATEMENTS and the Lending Activities section of Item 1. Business in Part I. for further discussion.
Actual loan losses may be significantly more than the allowances we have established, which would have a materially adverse effect on our financial results.
Income Taxes. Accounting for income taxes involves critical accounting policies and estimates due to the subjective nature of certain estimates that are involved in the calculation. We use the asset/liability method of accounting for income taxes in which deferred tax assets and liabilities are established for the temporary differences between the financial reporting basis
and the tax basis of our assets and liabilities. We must assess the realization of the deferred tax asset and, to the extent that we believe that recovery is not likely, a valuation allowance is established. Adjustments to increase or decrease existing valuation allowances, if any, are charged or credited, respectively, to income tax expense. At September 30, 2023, no valuation allowances were outstanding. Even though we have determined a valuation allowance is not required for deferred tax assets at September 30, 2023, there is no guarantee that those assets will be recognizable in the future.
Pension Benefits. The determination of our obligations and expense for pension benefits is dependent upon certain assumptions used in calculating such amounts. Key assumptions used in the actuarial valuations include the discount rate and expected long-term rate of return on plan assets. Actual results could differ from the assumptions and market driven rates may fluctuate. Significant differences in actual experience or significant changes in the assumptions could materially affect future pension obligations and expense.
