General. The majority of our assets and liabilities are monetary in nature. Consequently, our most significant form of market risk has historically been interest rate risk. In general, our assets, consisting primarily of mortgage loans, have longer maturities than our liabilities, consisting primarily of deposits and advances from the FHLB of Cincinnati. As a result, a fundamental component of our business strategy is to manage interest rate risk and limit the exposure of our net interest income to changes in market interest rates. Accordingly, our Board of Directors has established risk parameter limits deemed appropriate given our business strategy, operating environment, capital, liquidity and performance objectives. Additionally, our Board of Directors has authorized the formation of an Asset/Liability Management Committee comprised of key operating personnel, which is responsible for managing this risk in a manner that is consistent with the guidelines and risk limits approved by the Board of Directors. Further, the Board has established the Directors Risk Committee, which, among other responsibilities, conducts regular oversight and review of the guidelines, policies and deliberations of the Asset/Liability Management Committee. We manage our interest rate risk in order to control the exposure of our earnings and capital to changes in interest rates. Refer to the Overview section of Item 7 for additional discussion on how we manage interest rate risk.
Economic Value of Equity. Using customized modeling software, the Company and Association prepare periodic estimates of the amounts by which the net present value of cash flows from assets, liabilities and off-balance sheet items (the institutions economic value of equity or EVE) would change in the event of a range of assumed changes in market interest rates. The simulation model uses a discounted cash flow analysis and an option-based pricing approach in measuring the interest rate sensitivity of EVE. The model estimates the economic value of each type of asset, liability and off-balance sheet contract under the assumption that instantaneous changes (measured in basis points) occur at all maturities along the United States Treasury yield curve and other relevant market interest rates. A basis point equals one, one-hundredth of one percent, and 100 basis points equals one percent. An increase in interest rates from 2% to 3% would mean, for example, a 100 basis point increase in the Change in Interest Rates column below. The model is tailored specifically to our organization, which, we believe, improves its predictive accuracy. Computations of prospective effects of hypothetical interest rate changes are based on numerous assumptions, including relative levels of market interest rates, loan prepayments and deposit decay, and should not be relied upon as indicative of actual results.
