The manner in which actual yields, costs and consumer behavior respond to changes in market interest rates may vary from the inherent methodologies used to measure interest rate risk through changes in EVE. In this regard, the EVE tables presented above assume:
no new growth or business volumes;
that the composition of our interest-sensitive assets and liabilities existing at the beginning of a period remains constant over the period being measured, except for reductions to reflect mortgage loan principal repayments along with modeled prepayments and defaults, and deposit decays; and
that a particular change in interest rates is reflected uniformly across the yield curve regardless of the duration or repricing of specific assets and liabilities.
Accordingly, although the EVE tables provide an indication of our interest rate risk exposure as of the indicated dates, such measurements are not intended to and do not provide a precise forecast of the effect of changes in market interest rates on our EVE and will differ from actual results. In addition to our core business activities, which seek to originate Smart Rate (adjustable) loans, home equity lines of credit (adjustable) and 10-year fixed-rate loans funded by borrowings from the FHLB and intermediate term CDs (including brokered CDs), and which are intended to have a favorable impact on our IRR profile, the impact of several other items and events resulted in the 279 and 231 basis point deterioration in the Pre-Shock EVE Ratio (base valuation) measures at September 30, 2023, when compared to the measures at September 30, 2022 for the Company and Association, respectively. Factors contributing to these deteriorations included increases in market interest rates, capital actions by the Association, and changes due to business activity. While our core business activities, as described at the beginning of this paragraph, are generally intended to have a positive impact on our IRR profile, the actual impact is determined by a number of factors, including the pace of mortgage asset additions to our balance sheet (including consideration of outstanding commitments to originate those assets), in comparison to the pace of the addition of duration extending funding sources.
Our simulation model possesses random patterning capabilities and accommodates extensive regression analytics applicable to the prepayment and decay profiles of our borrower and depositor portfolios. The model facilitates the generation of alternative modeling scenarios and provides us with timely decision making data that is integral to our IRR management processes. Modeling our IRR profile and measuring our IRR exposure are processes that are subject to continuous revision, refinement, modification, enhancement, back testing and validation. We continually evaluate, challenge and update the methodology and assumptions used in our IRR model, including behavioral equations that have been derived based on third-party studies of our customers' historical performance patterns. Changes to the methodology and/or assumptions used in the model will result in reported IRR profiles and reported IRR exposures that will be different, and perhaps significantly, from the results reported above.
Earnings at Risk. In addition to EVE calculations, we use our simulation model to analyze the sensitivity of our net interest income to changes in interest rates (the institutions EaR). Net interest income is the difference between the interest income that we earn on our interest-earning assets, such as loans and securities, and the interest that we pay on our interest-
bearing liabilities, such as deposits and borrowings. In our model, we estimate what our net interest income would be for prospective 12 and 24 month periods using customized (based on our portfolio characteristics) assumptions with respect to loan prepayment rates, default rates and deposit decay rates, and the implied forward yield curve as of the market date for assumptions related to projected interest rates. We then calculate what the estimated net interest income would be for the same period under numerous interest rate scenarios. The simulation process is subject to continual enhancement, modification, refinement and adaptation. As of September 30, 2023, the estimated EaR for the 12 months ending September 30, 2024 would decrease by 1.75% for the Company and 2.71% for the Association in the event that market interest rates used in the simulation were adjusted in incremental amounts (termed a "ramped" format) during the 12 month measurement period to an aggregate increase in 200 basis points. The Company and Association use the "ramped" assumption in preparing the EaR simulation estimates for use in its public disclosures. The Company and Association continue to calculate instantaneous scenarios, and as of September 30, 2023, the estimated EaR for the 12 months ending September 30, 2024, would decrease by 5.16% and 6.91%, respectively, in the event of an instantaneous 200 basis point increase in market interest rates.
The manner in which actual yields, costs and consumer behavior respond to changes in market interest rates may vary from the inherent methodologies used to measure interest rate risk through EaR. In this regard, the interest rate risk information presented above assumes that a particular change in interest rates is reflected uniformly across the yield curve regardless of the duration or repricing of specific assets and liabilities. Accordingly, although interest rate risk calculations provide an indication of our interest rate risk exposure at a particular point in time, such measurements are not intended to and do not provide a precise forecast of the effect of changes in market interest rates on our net interest income and will differ from actual results. In addition to the preparation of computations as described above, we also formulate simulations based on a variety of non-linear changes in interest rates and a variety of non-constant balance sheet composition scenarios.
Other Considerations. The EVE and EaR analyses are similar in that they both start with the same month end balance sheet amounts, weighted average coupon and maturity. The underlying prepayment, decay and default assumptions are also the same and they both start with the same month end "markets" (Treasury and FHLB yield curves, etc.). From that similar starting point, the models follow divergent paths. EVE is a stochastic model using 150 different interest rate paths to compute market value at the account level for each of the categories on the balance sheet whereas EaR uses the implied forward curve to compute interest income/expense at the account level for each of the categories on the balance sheet.
EVE is considered as a point in time calculation with a "liquidation" view of the Company and Association where all the cash flows (including interest, principal and prepayments) are modeled and discounted using discount factors derived from the current market yield curves. It provides a long term view and helps to define changes in equity and duration as a result of changes in interest rates. On the other hand, EaR is based on balance sheet projections going one year and two years forward and assumes new business volume and pricing to calculate net interest income under different interest rate environments. EaR is calculated to determine the sensitivity of net interest income under different interest rate scenarios. With each of these models, specific policy limits have been established for the Association that are compared with the actual month end results. These limits have been approved by the Association's Board of Directors and are used as benchmarks to evaluate and moderate interest rate risk. In the event that there is a breach of policy limits that extends beyond two consecutive quarter end measurement periods, management is responsible for taking such action, similar to those described under the preceding heading of General, as may be necessary in order to return the Association's interest rate risk profile to a position that is in compliance with the policy. Item 8. Financial Statements and Supplementary Data
