Basis for Opinion
These financial statements are the responsibility of the Company's management. Our responsibility is to express an opinion on the Company's financial statements based on our audits. We are a public accounting firm registered with the PCAOB and are required to be independent with respect to the Company in accordance with the U.S. federal securities laws and the applicable rules and regulations of the Securities and Exchange Commission and the PCAOB.
We conducted our audits in accordance with the standards of the PCAOB. Those standards require that we plan and perform the audit to obtain reasonable assurance about whether the financial statements are free of material misstatement, whether due to error or fraud. Our audits included performing procedures to assess the risks of material misstatement of the financial statements, whether due to error or fraud, and performing procedures that respond to those risks. Such procedures included examining, on a test basis, evidence regarding the amounts and disclosures in the financial statements. Our audits also included evaluating the accounting principles used and significant estimates made by management, as well as evaluating the overall presentation of the financial statements. We believe that our audits provide a reasonable basis for our opinion.
Critical Audit Matter
The critical audit matter communicated below is a matter arising from the current-period audit of the financial statements that was communicated or required to be communicated to the audit committee and that (1) relates to accounts or disclosures that are material to the financial statements and (2) involved our especially challenging, subjective, or complex judgments. The communication of critical audit matters does not alter in any way our opinion on the financial statements, taken as a whole, and we are not, by communicating the critical audit matter below, providing a separate opinion on the critical audit matter or on the accounts or disclosures to which it relates.
Allowance for Credit Losses - Refer to Notes 1 and 5 to the financial statements
Critical Audit Matter Description
The allowance for credit losses (ACL) is managements estimate of expected credit losses in the loan portfolio, including off-balance sheet commitments. As discussed in Notes 1 and 5 of the consolidated financial statements, the ACL is an amount which represents managements best estimate of expected credit losses over the contractual life of the Companys loan portfolio as of the balance sheet date. We have identified the general valuation allowance ("GVA"), which is a component of ACL, for both the loan portfolio and off-balance sheet commitments, as a critical audit matter. GVA for the loan portfolio is comprised of quantitative general valuation allowances for credit losses based on historical loan loss, and qualitative adjustments to the quantitative general valuation allowances to cover uncertainties that affect the estimate of expected credit losses. GVA for off-balance sheet commitments is comprised of expected lifetime losses on unfunded loan commitments to extend credit where the obligations are not unconditionally cancellable.
As of September 30, 2023, the Company's loan portfolio totaled $15.2 billion, and the related ACL was $77.3 million, including $67.8 million GVA. The Company's off-balance sheet commitments totaled $5.1 billion, and the related GVA was $27.5 million. The GVA is established using relevant available information, relating to past events, current conditions, and reasonable and supportable forecasts. The Company utilizes loan level regression models with forecasted economic data to derive the probability of default and loss given default factors. These factors are used to calculate the loan level credit loss over a 24-month reasonable and supportable period with an immediate reversion to historical mean loss rates for the remaining life of the loans. Qualitative adjustments are then made to account for factors that management does not believe are captured in the Current Expected Credit Losses ("CECL") quantitative models. The determination of the appropriate level of the allowance for
the loan portfolio inherently involves a high degree of subjectivity and requires significant estimates of current credit risks using both quantitative and qualitative analyses.
Auditing certain aspects of the GVA, including the (1) model methodology, (2) model accuracy, (3) model assumptions, (4) selection of relevant risk characteristics, (5) interpretation of the results, and (6) use of qualitative adjustments, involves especially subjective and complex judgment. Given the significant judgment in determining the GVA estimate, performing audit procedures to evaluate the reasonableness of managements estimate of the GVA requires a high degree of auditor judgment and an increased extent of effort, including the need to involve our credit specialists.
How the Critical Audit Matter Was Addressed in the Audit
Our audit procedures related to the GVA included the following, among others:
We tested the effectiveness of controls over the Companys (1) model methodology, (2) model accuracy, (3) model assumptions, (4) selection of relevant risk characteristics, (5) interpretation of the results, and (6) use of qualitative adjustments.
With the assistance of our credit specialists, we evaluated the reasonableness of the (1) model methodology, (2) model accuracy, (3) model assumptions, (4) selection of relevant risk characteristics, and (5) interpretation of the results.
We evaluated trends in the total GVA for consistency with trends in loan portfolio growth and credit performance.
We tested the accuracy and completeness of key risk characteristics input into the model by agreeing to source information.
We assessed the Company's method for determining the qualitative factor adjustments and the effect of those factors on the GVA compared with relevant credit risk factors and credit trends.
