1. DESCRIPTION OF BUSINESS AND SUMMARY OF SIGNIFICANT ACCOUNTING POLICIES
Business-TFS Financial Corporation, a federally chartered stock holding company, conducts its principal activities through its wholly owned subsidiaries. The principal line of business of the Company is retail consumer banking, including mortgage lending, deposit gathering, and other financial services. Third Federal Savings and Loan Association of Cleveland, MHC, its federally chartered mutual holding company parent, owned 81.01% of the outstanding shares of common stock of the Company at September 30, 2023.
The Companys primary operating subsidiaries include the Association and Third Capital, Inc. The Association is a federal savings association, which provides retail loan and savings products to its customers in Ohio and Florida, through its 37 full-service branches, four loan production offices, customer service call center and internet site. The Association also provides savings products, purchase mortgages, first mortgage refinance loans, home equity lines of credit, and home equity loans in states outside of its branch footprint. The Association also acquires first mortgage loans through a correspondent lending partnership. Third Capital, Inc. was formed to hold non-thrift investments and subsidiaries.
The accounting and reporting policies of TFS Financial Corporation and its subsidiaries conform to accounting principles generally accepted in the United States of America and to general practices within the banking industry.
No material subsequent events have occurred requiring recognition in the consolidated financial statements or disclosure in the notes to the consolidated financial statements.
The following is a description of the significant accounting and reporting policies, which the Company follows in preparing and presenting its consolidated financial statements.
Basis of Consolidation and Reporting-The consolidated financial statements of the Company include the accounts of TFS Financial Corporation and its wholly owned subsidiaries. Intercompany balances and transactions have been eliminated in consolidation.
Estimates-The preparation of financial statements in conformity with GAAP requires management to make estimates and assumptions that affect the reported amounts of assets and liabilities at the date of the financial statements and the reported amounts of revenues and expenses during the reporting period. Actual results could differ from these estimates.
Cash and Cash Equivalents-Cash and cash equivalents consist of working cash on hand, and demand and interest bearing deposits at other financial institutions with maturities of three months or less. For purposes of reporting cash flows, cash and cash equivalents also includes federal funds sold, when applicable. The Company has acknowledged informal agreements with banks where it maintains deposits. Under these agreements, service fees charged to the Company are waived provided certain average compensating balances are maintained throughout each month.
Investment Securities-Our fixed-maturity securities are accounted for on an available-for-sale basis. Securities held as available-for-sale are reported at fair value, with the corresponding unrealized gains and (losses), net of deferred income taxes, reported in AOCI. Management determines the appropriate classification of investment securities based on its intent and ability to hold at the time of purchase. Purchases of securities are accounted for on a trade-date or settlement-date basis, depending on the settlement terms.
Realized gains and (losses) on securities are computed on a specific identification basis. Realized gains and (losses) also include changes in fair value on derivatives not designated as hedging instruments. Sales of securities are accounted for on a trade-date or settlement-date basis, depending on the settlement terms.
A decline in the fair value of any available for sale security, below cost, is evaluated for credit loss. Credit loss is recognized in earnings if management intends, or will more likely than not be required, to sell the security before the recovery of its amortized cost basis. If the present value of cash flows expected to be collected is less than the amortized cost basis of the security, then a credit loss exists and an allowance would be recognized as a credit loss expense, limited to the difference between fair value and amortized cost. Non-credit related loss is recognized in OCI, net of applicable deferred income taxes.
To determine whether a credit loss exists, the Company considers, among other things, adverse conditions related to the security, industry, geographic area, the payment schedule of the debt security and likelihood that the issuer will be able to make
payments that increase in the future, failure of the issuer to make scheduled payments and all available information relevant to the securities collectability, changes in ratings assigned by a rating agency, and other credit enhancements that affect the securities expected performance.
Investment income consist of interest and accretion (net of amortization). Interest is recognized on an accrual basis using the level-yield method. Premiums and discounts are amortized using the level-yield method.
Derivative Instruments-Derivative instruments are carried at fair value in the Company's financial statements. For derivative instruments that are designated and qualify as cash flow hedges, changes in the fair value of the derivative instrument are reported as a component of OCI, net of tax, and reclassified into earnings in the same period during which the hedged transaction affects earnings. The earnings effect of the hedging instrument will be presented in the same income statement line item as the earnings effect of the hedged item. AOCI will be adjusted to a balance that reflects the cumulative change in the fair value of the hedging instrument. At the inception of a hedge, the Company documents certain items, including the relationship between the hedging instrument and the hedged item, the risk management objective and the nature of the risk being hedged, a description of how effectiveness will be measured, an evaluation of hedge transaction effectiveness and the benchmark interest rate or contractually specified interest rate being hedged.
Hedge accounting is discontinued prospectively when (1) a derivative is no longer highly effective in offsetting changes in the fair value or cash flow of a hedged item, (2) a derivative expires or is sold, (3) a derivative is de-designated as a hedge, because it is unlikely that a forecasted transaction will occur, or (4) it is determined that designation of a derivative as a hedge is no longer appropriate. When hedge accounting is discontinued, the Company would continue to carry the derivative on the statement of condition at its fair value; however, changes in its fair value would be recorded in earnings instead of through OCI.
For derivative instruments not designated as hedging instruments, the Company recognizes gains and (losses) on the derivative instrument in current earnings during the period of change.
Mortgage Banking Activity-Mortgage loans originated or purchased and intended for sale in the secondary market are carried at the lower of cost or estimated fair value in the aggregate. Mortgage loans included in pending agency contracts to sell and securitize loans are carried at fair value. Fair value is based on quoted secondary market pricing for loan portfolios with similar characteristics and includes consideration of deferred fees (costs). Net unrealized gains or losses on loans carried at fair value, are recognized in a valuation allowance by charges to income.
The Company retains servicing on loans that are sold and initially recognizes an asset for mortgage loan servicing rights based on the fair value of the servicing rights. Residential mortgage loans represent the single class of servicing rights and are measured at the lower of cost or fair value on a recurring basis. Mortgage loan servicing rights are reported net of accumulated amortization, which is recorded in proportion to, and over the period of, estimated net servicing revenues. The Company monitors prepayments and changes amortization of mortgage servicing rights accordingly. Fair values are estimated using discounted cash flows based on current interest rates and prepayment assumptions, and impairment is monitored each quarterly reporting period. The impairment analysis is based on predominant risk characteristics of the loans serviced, such as type, fixed- and adjustable-rate loans, original terms and interest rates. The amount of impairment recognized is the amount by which the mortgage loan servicing assets exceed their fair value.
Servicing fee income net of amortization and other loan fees collected on loans serviced for others are included in Fees and service charges, net of amortization on the CONSOLIDATED STATEMENTS OF INCOME.
Loans and Related Deferred Loan Expenses, net-Loans originated or purchased with the intent to hold into the foreseeable future are carried at unpaid principal balances adjusted for partial charge-offs, the allowance for credit losses and net deferred loan expenses. Interest on loans is accrued and credited to income as earned. Interest on loans is not recognized in income when collectability is uncertain.
Loan fees and certain direct loan origination costs are deferred and recognized as an adjustment to interest income using the level-yield method over the contractual lives of related loans, if the loans are held for investment. If the loans are held for sale, net deferred fees (costs) are generally not amortized, but rather are recognized when the related loans are sold.
Loans are classified as TDRs when the original contractual terms are restructured to provide a concession to a borrower experiencing financial difficulty under terms that would not otherwise be available and the restructuring is the result of an agreement between the Company and the borrower or is imposed by a court or law. Concessions granted in TDRs may include a reduction of the stated interest rate, a reduction or forbearance of principal, an extension of the maturity date, a significant delay in payments, the removal of one or more borrowers from the obligation, or any combination of these.
Allowance for Credit Losses-The allowance for credit losses represents the estimate of lifetime losses in our loan portfolio and off-balance sheet commitments. The allowance for credit losses is assessed on a quarterly basis and provisions (releases) for credit losses are made accordingly. The allowance is established using relevant available information, relating to past events, current conditions and supportable economic forecasts. Historical credit loss experience provides the basis for the estimation of expected credit losses. Qualitative adjustments to historical loss information are made for differences in current loan-specific risk characteristics such as differences in underwriting standards, portfolio mix, delinquency status or likely recovery of previous loan charge-offs. The allowance for credit losses is increased by recoveries and decreased by charge-offs. Also, qualitative adjustments were made to reflect expected recovery of loan amounts previously charged-off, beyond what the model is able to project.
For further discussion on the allowance for credit losses, non-accrual, and TDRs, see Note 5. LOANS AND ALLOWANCE FOR CREDIT LOSSES.
Real Estate Owned, net-Real estate owned, net represents real estate acquired through foreclosure or deed in lieu of foreclosure and is initially recorded at fair value, less estimated costs to sell. Subsequent to acquisition, real estate owned is carried at the lower of cost or fair value, less estimated selling costs. Management performs periodic valuations and a valuation allowance is established by a charge to income for any excess of the carrying value over the fair value, less estimated costs to sell the property. Recoveries in fair value during the holding period are recognized until the valuation allowance is reduced to zero. Costs related to holding and maintaining the property are charged to expense.
Premises, Equipment, and Software, net-Depreciation and amortization of premises, equipment and software is computed on a straight-line basis over the estimated useful lives of the related assets. Estimated lives are 31.5 years for office facilities and three to 10 years for equipment and software. Amortization of leasehold or building improvements is computed on a straight-line basis over the lesser of the economic useful life of the improvement or term of the lease, typically 10 years.
Leases-At inception, all contracts are evaluated to determine if the arrangement contains a lease based on the terms and conditions. As a lessee, the Company recognizes leases with terms greater than one year on the CONSOLIDATED STATEMENTS OF CONDITION as lease assets (a right-of-use asset) and lease liabilities (a liability to make lease payments), measured on a discounted basis. For further discussion on leases, see Note 8. LEASES.
Bank Owned Life Insurance Contracts-Life insurance is provided under both whole and split dollar life insurance agreements. Policy premiums were prepaid and the Company will recover the premiums paid from the proceeds of the policies. The Company recognizes death benefits and growth in the cash surrender value of the policies in other non-interest income.
Goodwill-The excess of purchase price over the fair value of net assets of acquired companies is classified as goodwill and reported in Other Assets. Goodwill was $9,732 at September 30, 2023 and 2022. Goodwill is reviewed for impairment on an annual basis as of September 30. No impairment was identified as of September 30, 2023 or 2022.
Taxes on Income-Deferred tax assets and liabilities are recognized for the future tax consequences attributable to differences between the financial statement carrying amounts of existing assets and liabilities and their respective tax bases. Deferred tax assets and liabilities are measured using enacted tax rates expected to apply to taxable income in the years in which those temporary differences are expected to be recovered or settled. The effect on deferred tax assets and liabilities of a change in tax rates is recognized in income in the period that includes the enactment date. Additional information about policies related to income taxes is included in Note 12. INCOME TAXES.
Deposits-Interest on deposits is accrued and charged to expense monthly and is paid or credited in accordance with the terms of the accounts.
Treasury Stock-Acquisitions of treasury stock through stock repurchases are recorded at cost using the cost method of accounting. Repurchases may be made through open market purchases, block trades and in negotiated private transactions, subject to the availability of stock, general market conditions, the trading price of the stock, alternative uses for capital, and the Companys financial performance. Repurchased shares will be available for general corporate purposes.
Accumulated Other Comprehensive Income (Loss)-AOCI consists of changes in pension obligations, changes in unrealized gains (losses) on securities available for sale and cash flow hedges, each of which is net of the related income tax effects. The Company's policy is to release income tax effects from AOCI only when the entire portfolio to which the underlying transactions relate to is liquidated, sold or extinguished.
Revenue from Contracts with Customers-The core principle of the guidance requires an entity to recognize revenue to depict the transfer of goods or services to customers in an amount that reflects the consideration to which the entity expects to be entitled to receive in exchange for those goods or services. Three of the Company's revenue streams within scope of Topic
606 are the sales of REO, interchange income, and deposit account and other transaction-based service fee income. Those streams are immaterial and therefore quantitative information regarding these streams is not disclosed.
Pension Benefits-The determination of our obligations and expense for pension benefits is dependent upon certain assumptions used in calculating such amounts. Key assumptions used in the actuarial valuations include the discount rate and expected long-term rate of return on plan assets. Actual results could differ from the assumptions and market driven rates may fluctuate. Significant differences in actual experience or significant changes in the assumptions could materially affect future pension obligations and expense.
Share-Based Compensation-Compensation expense for awards of equity instruments is recognized on a straight-line basis over the requisite service period based on the grant date fair value estimated in accordance with the provisions of FASB ASC 718 Compensation-Stock Compensation. All vested equity instruments are settled in stock. Forfeitures are recognized as they occur. Share-based compensation expense is included in Salaries and employee benefits in the CONSOLIDATED STATEMENTS OF INCOME. Tax benefits or deficiencies recognized for the difference between realized deductions and cumulative book compensation cost on share-based compensation awards are included in operating cash flows on the CONSOLIDATED STATEMENTS OF CASH FLOW.
The grant date fair value of stock options is estimated using the Black-Scholes option-pricing model using assumptions for the expected option term, expected stock price volatility, risk-free interest rate, and expected dividend yield. Due to limited historical data on exercise of share options, the simplified method is used to estimate expected option term.
Marketing Costs-Marketing costs are expensed as incurred.
Earnings per Share-Basic EPS is computed by dividing net income by the weighted-average number of shares of common stock outstanding. Outstanding shares include shares sold to subscribers, shares held by the Third Federal Foundation, shares of the Employee Stock Ownership Plan which have been allocated or committed to be released for allocation to participants, and shares held by Third Federal Savings, MHC. Unvested shares awarded in the Company's share-based compensation plan are treated as participating securities for purposes of the two-class method when they contain nonforfeitable rights to dividends, but are not included in the number of shares in the computation of basic EPS. The two-class method is an earnings allocation that determines EPS for each class of common stock and participating security.
Diluted EPS is computed using the same method as basic EPS, but the weighted-average number of shares reflects the potential dilution, if any, of unexercised stock options, unvested shares of performance share units and unvested shares of restricted stock units that could occur if stock options were exercised and performance share units and restricted stock units were issued and converted into common stock. These potentially dilutive shares would then be included in the number of weighted-average shares outstanding for the period using the treasury stock method. At September 30, 2023, 2022 and 2021, potentially dilutive shares include stock options, restricted stock units and performance share units issued through share-based compensation plans.
2. STOCK TRANSACTIONS
TFS Financial Corporation completed its initial public stock offering on April 20, 2007 and sold 100,199,618 shares, or 30.16% of its post-offering outstanding common stock, to subscribers in the offering. Third Federal Savings, MHC, the Companys mutual holding company parent, holds 227,119,132 shares of TFS Financial Corporations outstanding common stock. TFS Financial Corporation issued 5,000,000 shares of common stock, or 1.50% of its post-offering outstanding common stock, to Third Federal Foundation.
Pursuant to the eighth repurchase program for the repurchase of 10,000,000 shares authorized by the Board of Directors in October, 2016, 361,869 shares were repurchased during the year ended September 30, 2023, 337,259 shares were repurchased during the year ended September 30, 2022, and no shares were repurchased during the year ended September 30, 2021. At September 30, 2023, there were 5,191,951 shares remaining to be purchased under the eighth repurchase program. The Company previously repurchased 51,300,000 shares of the Companys common stock as part of the previous seven Board of Directors-approved share repurchase programs. In total, the Company has repurchased 56,108,049 shares of the Company's common stock as of September 30, 2023.
3. REGULATORY MATTERS
The Association is subject to various regulatory capital requirements administered by the federal banking agencies. Failure to meet minimum capital requirements can initiate certain mandatory and possibly additional discretionary actions by regulators that, if undertaken, could have a direct material effect on the financial statements of the Association. Under capital adequacy guidelines and the regulatory framework for prompt corrective action, the Association must meet specific capital
guidelines that involve quantitative measures of its assets, liabilities, and certain off-balance-sheet items as calculated under regulatory accounting practices. The capital amounts and classifications are also subject to qualitative judgments by the regulators about components, risk weightings, and other factors.
Quantitative measures established by regulation to ensure capital adequacy require the Association to maintain minimum amounts and ratios (set forth in table below) of common equity Tier 1, Tier 1, and Total capital (as defined in the regulations) to risk-weighted assets (as defined) and Tier 1 capital (as defined) to net average assets (as defined). The risk-based capital guidelines include both a definition of capital and a framework for calculating risk-weighted assets by assigning balance sheet assets and off-balance sheet assets to broad risk categories.
In 2019, a final rule adopted by the federal banking agencies provided banking organizations with the option to phase in, over a three-year period, the adverse day-one regulatory capital effects of the adoption of the CECL accounting standard. In 2020, as part of its response to the impact of COVID-19, U.S. federal banking regulatory agencies issued a final rule which provides banking organizations that implement CECL during the 2020 calendar year the option to delay for two years an estimate of CECLs effect on regulatory capital, relative to the incurred loss methodologys effect on regulatory capital, followed by a three-year transition period, which the Association and Company have adopted. During the two-year delay, the Association and Company added back to CET1 100% of the initial adoption impact of CECL plus 25% of the cumulative quarterly changes in the allowance for credit losses. Beginning this fiscal year, the cumulative transitional amounts became fixed and will be phased out of CET1 capital over the subsequent three-year period. At September 30, 2023, the Association exceeded all regulatory capital requirements and is considered well capitalized under regulatory guidelines.
The Association operates under the capital requirements for the standardized approach of the Basel III capital framework for U.S. banking organizations (Basel III Rules), which limits capital distributions and certain discretionary bonus payments to management if the institution does not hold a "capital conservation buffer" consisting of 2.5% in addition to the minimum capital requirements. At September 30, 2023, the Association exceeded the fully phased-in regulatory requirement for the "capital conservation buffer".
