A large concentration of the Companys lending is in Ohio and Florida. As of September 30, 2023, and September 30, 2022, the percentage of aggregate Residential Core, Home Today and Construction loans secured by properties in Ohio was 57% and 56%, respectively, and the percentage of loans secured by properties in Florida was 18% as of both dates. As of September 30, 2023 and September 30, 2022, home equity loans and lines of credit were concentrated in the states of Ohio (26% and 27%, respectively), Florida (22% and 20%, respectively), and California (17% and 16%, respectively).
Residential Core mortgage loans represent the largest portion of the residential real estate portfolio. The Company believes overall credit risk is low based on the nature, composition, collateral, products, lien position and performance of the portfolio. The portfolio does not include loan types or structures that have experienced severe performance problems at other financial institutions (sub-prime, no documentation or pay-option adjustable-rate mortgages). The portfolio contains "Smart Rate" adjustable-rate mortgage loans whereby the interest rate is locked initially for three or five years then resets annually, subject to periodic rate adjustments caps and various re-lock options available to the borrower. Although the borrower is qualified for its loan at a higher rate than the initial rate offered, the adjustable-rate feature may impact a borrower's ability to afford the higher payments upon rate reset during periods of rising interest rates while this repayment risk may be reduced in a declining or low rate environment. With limited historical loss experience compared to other types of loans in the portfolio, judgment is required by management in assessing the allowance required on adjustable-rate mortgage loans. The principal amount of adjustable-rate mortgage loans included in the Residential Core portfolio was $4,760,843 and $4,668,089 at September 30, 2023 and September 30, 2022, respectively.
Home Today was an affordable housing program targeted to benefit low- and moderate-income home buyers. Most loans under the program were originated prior to 2009. No new loans were originated under the Home Today program after September 30, 2016. Home Today loans have greater credit risk than traditional residential real estate mortgage loans.
Home equity loans and lines of credit, which are comprised primarily of home equity lines of credit, represent a significant portion of the residential real estate portfolio and include monthly principal and interest payments throughout the entire term. Once the draw period on lines of credit has expired, the accounts are included in the home equity loan balance. The full credit exposure on home equity lines of credit is secured by the value of the collateral real estate at the time of origination.
The Company originates construction loans to individuals for the construction of their personal single-family residence by a qualified builder (construction/permanent loans). The Companys construction/permanent loans generally provide for disbursements to the builder or sub-contractors during the construction phase as work progresses. During the construction phase, the borrower only pays interest on the drawn balance. Upon completion of construction, the loan converts to a permanent
amortizing loan without the expense of a second closing. The Company offers construction/permanent loans with fixed or adjustable-rates, and a current maximum loan-to-completed-appraised value ratio of 85%.
Other loans are comprised of loans secured by certificate of deposit accounts, which are fully recoverable in the event of non-payment, and forgivable down payment assistance loans, which are unsecured loans used as down payment assistance to borrowers qualified through partner housing agencies. The Company records a liability for the down payment assistance loans which are forgiven in equal increments over a pre-determined term, subject to residency requirements.
Loans held for sale include loans originated with the intent to sell which are generally priced in alignment with secondary market pricing and may be subject to loan level pricing adjustments. Additionally, loans originated or purchased for the held for investment portfolio may later be identified for sale and transferred to the held for sale portfolio, which may include loans originated or purchased within the parameters of programs established by Fannie Mae. During the years ended September 30, 2023 and September 30, 2022, reclassifications to the held for sale portfolio included loans that were sold during the period, including those in contracts pending settlement at the end of the period, and loans originated for the held for investment portfolio that were later identified for sale. At September 30, 2023 and September 30, 2022, mortgage loans held for sale totaled $3,260 and $9,661, respectively. During the years ended September 30, 2023 and September 30, 2022, the principal balance of loans sold was $77,205 and $128,118, respectively. During the years ended September 30, 2023 and September 30, 2022, the amortized cost of loans classified as held for sale that were subsequently transferred to the held for investment portfolio was $8,433 and $22,741, respectively. These transfers were due to changes in market pricing, affected by the rise in long-term interest rates, and managements' intent to hold the loans in portfolio until maturity for the foreseeable future. During the year ended September 30, 2021, there were no transfers to the held for investment portfolio.
