8. LEASES
As a lessee, the Company enters into operating leases of buildings and land. The Company occupies certain banking branches, loan production and customer service offices and a disaster recovery site through non-cancellable operating leases with remaining terms from less than one year to 13 years. Most of the leases have fixed payment terms with annual fixed-escalation clauses. Certain leases have annual rent escalations based on subsequent year-to-year changes in the consumer price index. These year-to-year changes in the consumer price index are excluded from the calculation of right-of-use assets and lease liabilities and recognized as expense in the period in which they are incurred. Additionally, all variable lease costs that are not based on an index or rate, such as "common area maintenance" costs, are expensed as incurred. Most of the Company's leases include options to extend for periods that range from three to five years. The leases do not have early-termination options. The Company has not included term extensions in the calculation of the lease term, as the Company does not consider it reasonably certain that the options will be exercised. As the interest rate implicit in all of the Company's lease contracts is not readily determinable, the Company utilized its incremental borrowing rate, which is the rate that would be incurred to borrow on a collateralized basis over a similar term on an amount equal to the total contractual lease payments in a similar economic environment. The incremental borrowing rate utilized for all the Company's leases is the FHLB Advance rate based on the lease term at commencement in determining the present value of lease payments.
