401(k) Savings Plan-The Company maintains a 401(k) savings plan that is comprised of three tiers. The first tier allows eligible employees to contribute up to 75% of their compensation to the plan, subject to limitations established by the Internal Revenue Service, with the Company matching 100% of up to 4% on funds contributed. The second tier permits the Company to make a profit-sharing contribution at its discretion. The first and second tiers cover substantially all employees who have reached age 18 and have worked 30 days of service in one year of service. The third tier permits the Company to make discretionary contributions allocable to eligible employees including those eligible employees who are participants, but no longer receiving service credits, under the Companys defined benefit pension plan. Voluntary contributions made by employees are vested at all times whereas Company contributions and Company matching contributions are subject to various vesting periods which range from immediately vested to fully vesting upon five years of service.
