Employee (Associate) Stock Ownership Plan-The Company established an ESOP for its employees effective January 1, 2006. The ESOP is a tax-qualified plan designed to invest primarily in the Companys common stock and provides employees with an opportunity to receive a funded retirement benefit, based on the value of the Companys common stock. The ESOP covers all eligible employees of the Company and its wholly-owned subsidiaries. Employees are eligible to participate in the ESOP after attainment of age 18, completion of 1,000 hours of service, and employment on the last day of the plans calendar year. Company contributions to the plan are at the discretion of the Board of Directors. The ESOP is accounted for in accordance with the provisions for stock compensation in FASB ASC 718. Compensation expense for the ESOP is based on the market price of the Companys stock and is recognized as shares are committed to be released to participants. The total compensation expense related to this plan in the 2023, 2022 and 2021 fiscal years was $5,761, $7,063 and $8,270, respectively.
