15. COMMITMENTS AND CONTINGENT LIABILITIES
In the normal course of business, the Company enters into commitments with off-balance-sheet risk to meet the financing needs of its customers. Commitments to extend credit are agreements to lend to a customer as long as there is no violation of any condition established in the contract. Commitments to originate or purchase loans generally have fixed expiration dates of 60 to 360 days or other termination clauses and may require payment of a fee. Unfunded commitments related to home equity lines of credit generally expire from five to 10 years following the date that the line of credit was established, subject to various conditions including compliance with payment obligation, adequacy of collateral securing the line and maintenance of a satisfactory credit profile by the borrower. Since some of the commitments may expire without being drawn upon, the total commitment amounts do not necessarily represent future cash requirements.
Off-balance sheet commitments to extend credit involve elements of credit risk and interest rate risk in excess of the amount recognized in the CONSOLIDATED STATEMENTS OF CONDITION. The Companys exposure to credit loss in the event of nonperformance by the other party to the commitment is represented by the contractual amount of the commitment. The Company generally uses the same credit policies in making commitments as it does for on-balance-sheet instruments. The allowance for credit losses related to off-balance sheet commitments is recorded in other liabilities in the CONSOLIDATED STATEMENTS OF CONDITION. Refer to Note 5. LOANS AND ALLOWANCES FOR CREDIT LOSSES for discussion on
credit loss methodology. Interest rate risk on commitments to extend credit results from the possibility that interest rates may have moved unfavorably from the position of the Company since the time the commitment was made.
