16. FAIR VALUE
Under U.S. GAAP, fair value is defined as the price that would be received to sell an asset, or paid to transfer a liability, in an orderly transaction between market participants at the measurement date under current market conditions. A fair value framework is established whereby assets and liabilities measured at fair value are grouped into three levels of a fair value hierarchy, based on the transparency of inputs and the reliability of assumptions used to estimate fair value.
As permitted under the fair value guidance in U.S. GAAP, the Company elects to measure at fair value, mortgage loans classified as held for sale that are subject to pending agency contracts to securitize and sell loans. This election is expected to reduce volatility in earnings related to market fluctuations between the contract trade and settlement dates. At September 30, 2023 and September 30, 2022, there were no pending agency contracts held for sale. For the years ended September 30, 2023, 2022, and 2021, net gain (loss) on the sale of loans includes $0, $0 and $134, respectively, related to unrealized gains or losses during the period due to changes in the fair value of loans held for sale subject to pending agency contracts.
Presented below is a discussion of the methods and significant assumptions used by the Company to estimate fair value.
Investment Securities Available for Sale-Investment securities available for sale are recorded at fair value on a recurring basis. At September 30, 2023 and 2022, this includes $508,324 and $457,908, respectively, of investments in U.S. government and agency obligations including U.S. Treasury notes and investments in highly liquid collateralized mortgage obligations, that can include items issued by Fannie Mae, Freddie Mac, and Ginnie Mae, measured using the market approach. The fair values of investment securities represent unadjusted price estimates obtained from third party independent nationally recognized pricing services using pricing models or quoted prices of securities with similar characteristics and are included in Level 2 of the hierarchy. Third party pricing is reviewed on a monthly basis for reasonableness based on the market knowledge and experience of company personnel that interact daily with the markets for these types of securities.
Mortgage Loans Held for Sale-The fair value of mortgage loans held for sale is estimated on an aggregate basis using a market approach based on quoted secondary market pricing for loan portfolios with similar characteristics. Loans held for sale are carried at the lower of cost or fair value except, as described above, the Company elects the fair value measurement option for mortgage loans held for sale subject to pending agency contracts to securitize and sell loans. Loans held for sale are included in Level 2 of the hierarchy. At September 30, 2023 and 2022, there were $3,260 and $9,661, respectively, of loans held for sale measured at fair value. At September 30, 2023 and 2022 there were no loans held for sale carried at cost. Interest income on mortgage loans held for sale is recorded in interest income on loans.
Collateral-Dependent Loans-Collateral-dependent loans represent certain loans held for investment that are subject to a fair value measurement under U.S. GAAP because they are individually evaluated using a fair value measurement, such as the fair value of the underlying collateral. Credit loss is measured using a market approach based on the fair value of the collateral, less estimated costs to dispose, for loans the Company considers to be collateral-dependent due to a delinquency status or other adverse condition severe enough to indicate that the borrower can no longer be relied upon as the continued source of repayment. These conditions are described more fully in Note 5. LOANS AND ALLOWANCES FOR CREDIT LOSSES. To calculate the credit loss of collateral-dependent loans, the fair market values of the collateral, estimated using third-party appraisals in the majority of instances, are reduced by calculated estimated costs to dispose, derived from historical experience and recent market conditions. Any indicated credit loss is recognized by a charge to the allowance for credit losses. Subsequent increases in collateral values or principal pay downs on loans with recognized credit loss could result in a collateral-dependent loan being carried below its fair value. When no credit loss is indicated, the carrying amount is considered to approximate the fair value of that loan to the Company because contractually that is the maximum repayment the Company can expect. The amortized cost of loans individually evaluated for credit loss based on the fair value of the collateral are included in Level 3 of the hierarchy with assets measured at fair value on a non-recurring basis. The range and weighted average impact of estimated costs to dispose on fair values is determined at the time of credit loss or when additional credit loss is recognized and is included in quantitative information about significant unobservable inputs later in this note.
Loans held for investment that have been restructured in TDRs, are performing according to the restructured terms of the loan agreement and are not evaluated based on collateral, are individually evaluated for credit loss using the present value of future cash flows based on the loans effective interest rate, which is not a fair value measurement. At September 30, 2023 and 2022, this included $74,691 and $76,692, respectively, in amortized costs of TDRs with related allowances for loss of $9,546 and $10,284.
Real Estate Owned-Real estate owned includes real estate acquired as a result of foreclosure, or by deed in lieu of foreclosure, and is carried at the lower of the cost basis or fair value, less estimated costs to dispose. The carrying amounts of real estate owned at September 30, 2023 and September 30, 2022 were $1,444 and $1,191, respectively. Fair value is estimated under the market approach using independent third party appraisals. As these properties are actively marketed, estimated fair values may be adjusted by management to reflect current economic and market conditions. At September 30, 2023 and 2022, these adjustments were not significant to reported fair values. At September 30, 2023 and 2022, respectively, $1,413 and $1,192 of real estate owned is included in Level 3 of the hierarchy with assets measured at fair value on a non-recurring basis where the cost basis equals or exceeds the estimated fair values, less estimated costs to dispose, of $163 and $156, respectively. Real estate owned includes $194 and $155 of properties carried at their original or adjusted cost basis at September 30, 2023 and 2022, respectively.
Derivatives-Derivative instruments include interest rate locks on commitments to originate loans for the held for sale portfolio, forward commitments on contracts to deliver mortgage loans, and interest rate swaps designated as cash flow hedges. Derivatives not designated as cash flow hedges are reported at fair value in Other assets or Other liabilities on the CONSOLIDATED STATEMENT OF CONDITION with changes in value recorded in current earnings. Derivatives qualifying as cash flow hedges are settled daily, bringing their fair value to $0. Refer to Note 17. DERIVATIVE INSTRUMENTS for additional information on cash flow hedges and other derivative instruments. The fair value of interest rate lock commitments is adjusted by a closure rate based on the estimated percentage of commitments that will result in closed loans. The range and weighted average impact of the closure rate is included in quantitative information about significant unobservable inputs later in this note. A significant change in the closure rate may result in a significant change in the ending fair value measurement of these derivatives relative to their total fair value. Because the closure rate is a significantly unobservable assumption, interest rate lock commitments are included in Level 3 of the hierarchy. Forward commitments on contracts to deliver mortgage loans are included in Level 2 of the hierarchy.
