17. DERIVATIVE INSTRUMENTS
The Company enters into interest rate swaps to add stability to interest expense and manage exposure to interest rate movements as part of an overall risk management strategy. For hedges of the Company's borrowing and deposit program, interest rate swaps designated as cash flow hedges involve the receipt of variable amounts from a counterparty in exchange for the Company making fixed payments. These derivatives are used to hedge the forecasted cash outflows associated with the Company's FHLB borrowings and brokered certificates of deposit.
Cash flow hedges are initially assessed for effectiveness using regression analysis. Changes in the fair value of derivatives designated and that qualify as cash flow hedges is recorded in OCI and is subsequently reclassified into earnings during the period in which the hedged forecasted transaction affects earnings. Quarterly, a quantitative analysis is preformed to monitor the ongoing effectiveness of the hedging instrument. All derivative positions were initially, and continue to be, highly effective at September 30, 2023.
The Company enters into forward commitments for the sale of mortgage loans primarily to protect against the risk of lost revenue from adverse interest rate movements on net income. The Company recognizes the fair value of such contracts when the characteristics of those contracts meet the definition of a derivative. These derivatives are not designated in a hedging relationship; therefore, gains and losses are recognized immediately in the CONSOLIDATED STATEMENTS OF INCOME.
In addition, the Company is party to derivative instruments when it enters into interest rate lock commitments to originate a portion of its loans, which when funded, are classified as held for sale. Such commitments are not designated in a hedging relationship; therefore, gains and losses are recognized immediately in the CONSOLIDATED STATEMENTS OF INCOME.
In accordance with the reference rate reform, for every LIBOR referenced interest rate swap with a reset date after the LIBOR cessation date, counterparties received a LIBOR referenced instrument maturing on the first reset date after the LIBOR cessation date, and a forward starting SOFR instrument. At September 30, 2023, all previous LIBOR referenced swaps have transitioned to a SOFR-based rate. Additionally, under previously adopted ASU 2020-04, Reference Rate Reform (Topic 848), the Company has elected and applied certain optional expedients for eligible hedging relationships impacted by the LIBOR cessation.
