19. EARNINGS PER SHARE
Basic earnings per share is the amount of earnings available to each share of common stock outstanding during the reporting period. Diluted earnings per share is the amount of earnings available to each share of common stock outstanding during the reporting period adjusted to include the effect of potentially dilutive common shares. For purposes of computing earnings per share amounts, outstanding shares include shares held by the public, shares held by the ESOP that have been allocated to participants or committed to be released for allocation to participants and the 227,119,132 shares held by Third Federal Savings, MHC. For purposes of computing dilutive earnings per share, stock options and restricted and performance share units with a dilutive impact are added to the outstanding shares used in the basic earnings per share calculation. Unvested shares awarded pursuant to the Company's restricted stock plans are treated as participating securities in the computation of EPS pursuant to the two-class method as they contain nonforfeitable rights to dividends. The two-class method is an earnings allocation that determines EPS for each class of common stock and participating security. Performance share units, determined to be contingently issuable and not participating securities, are excluded from the calculation of basic EPS. At September 30, 2023 and 2022, the ESOP held 2,708,371 and 3,141,711 shares, respectively, that were neither allocated to participants nor committed to be released to participants.
