20. RECENT ACCOUNTING PRONOUNCEMENTS
Adopted in fiscal year ended September 30, 2023
In December of 2022, the FASB issued ASU 2022-06, Reference Rate Reform (Topic 848): Deferral of the Sunset Date of Topic 848. This ASU deferred the period of time entities can utilize the reference rate reform relief guidance from ASU 2020-04, Reference Rate Reform (Topic 848): Facilitation of the Effect of Reference Rate Reform on Financial Reporting, to December 31, 2024 instead of the original December 31, 2022. This amendment is a result of the expectation that the LIBOR would cease to be published as of June 30, 2023. The FASB Board decided that this amendment would be effective for all entities upon issuance of ASU 2022-06. This update did not have a material impact on the Company's consolidated financial condition or results of operation.
In March 2023, the FASB issued ASU 2023-02, Investments - Equity Method and Joint Ventures (Topic 323). The amendments in this update expand the proportional amortization method, by election, to account for all investments made primarily for the purpose of receiving income tax credits or other tax benefits. Previously, this accounting method was only allowed for low-income housing tax credit investments. This update is effective for fiscal years beginning after December 15, 2023, with early adoption permitted in any interim period. The Company adopted this update effective April 1, 2023 and will consider the provisions on future tax credit investments, should they occur. This update did not have an immediate impact on our consolidated financial condition or results of operations.
Issued but not yet adopted as of September 30, 2023
In March 2022, the FASB issued ASU 2022-02, Financial Instruments - Credit Losses (Topic 326). The amendments in this Update eliminate the accounting guidance for TDR by creditors in Subtopic 310-40, while enhancing disclosure requirements for certain loan refinancings and restructurings by creditors when the borrower is experiencing financial difficulty. This will be done by applying the loan refinancing and restructuring guidance to determine whether a modification results in a new loan or a continuation of an existing loan. Additionally, this amendment requires that an entity disclose current-period gross write-offs by year of origination for financing receivables and net investments in leases within the scope of Subtopic 326-20. This update is effective for fiscal years beginning after December 15, 2022, with early adoption permitted. The Company plans to adopt this guidance as of October 1, 2023 and apply the modified retrospective transition method that will evaluate loans previously identified as TDRs for credit loss under the Companys current ACL policy. We expect to recognize an increase to opening retained earnings of $7,898, net of income taxes resulting from a pretax decrease to the allowance for credit losses on loans and unfunded commitments of $10,262 upon adoption. The enhanced disclosure requirements provided for by the ASU will be adopted on a prospective basis.
The Company has determined that all other recently issued accounting pronouncements will not have a material impact on the Company's consolidated financial statements or do not apply to its operations.
